#EqualResearchDay was yesterday, a very important day. 𝗪𝗛𝗬 𝗝𝗨𝗡𝗘 𝟭𝟬? The gender health gap is rooted in a simple but shocking fact: Women weren’t required in clinical research until June 10, *1993*, when Congress passed the NIH Revitalization Act.

It’s been 30 years since this law was passed — but we still haven’t reached equal representation or reversed the effects of this research gap. 

🔑 That’s why @evvy created #EqualResearchDay on June 10th — think Equal Pay Day, but for disparities in science & medical research.

Equal Research Day is a call to promote inclusive research, tell our stories, and close the gender health gap. 

𝗛𝗢𝗪 𝗬𝗢𝗨 𝗖𝗔𝗡 𝗛𝗘𝗟𝗣:  
💙 Share this — for every social post in June that tags @evvy and #EqualResearchDay, Evvy will donate $1 to Women’s Health Access Matters* (@whamnow) 

