This year’s Equal Research Day highlights the 30th anniversary of the NIH Revitalization Act of 1993, which required the inclusion of women in U.S. clinical research for the first time. Though we match the use of the term “women” for historical accuracy, we note that an intersectional approach to sex and gender was not taken in the development and application of this law. 

The intent of Equal Research Day is to shine a light on all groups who have been underrepresented in clinical research — trans and non-binary people, people of color, people with disabilities, older adults, pregnant people, and more.

